    false,nt"url": null,nt"notes": "This annual narrative report for Seney
    NWR and Huron Islands NWR outlines Refuge accomplishments during the 1979 calendar
    year. The report begins with an introduction to the Refuge and information about
    climatic and habitat conditions, land acquisition, and the system status. Construction,
    maintenance, and wildfires are also described. Habitat management is covered; croplands,
    wetlands, forestlands, and wilderness and special areas are discussed. The wildlife
    section of the report discusses endangered and threatened species, migratory birds,
    mammals, and non-migratory birds. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Field investigations, cooperative programs, items of interest, and safety information
    are discussed. Photographs are attached.",nt"license_title": "License Not
